import logo from '../../img/logoHeader.svg'
import './css/Home.css'

function Header() {
   return (
      <header className="HeaderHome">
         <img src={logo} />
         <nav className="navHeader">
            <ul></ul>
         </nav>
      </header>
   )
}

export default Header
